/** 
 * @auteur
 * @fonction ProductListPage
 **/



const ProductListPage = (props) => {

    const renderProduct = () => {
    console.log(props);
    const params = getParams(props.location.search);
    let content = null;
    switch(params.type){
        case 'store':
            content = <ProductStore {...props} />
            break;
            case 'page':
                content = <ProductPage {...props} />
    }

}
 

    return (
        <Layout>
         
         {renderProduct()}
        </Layout>
    )
}


export default ProductListPage;
